import React,{Component} from 'react';
import tasks from './sample/tasks.json';


class Tasks extends Component {

   state = {
       tasks: tasks
   }

    render () {
        return <div> {this.state.tasks.map(e => <p key={e.id}> {e.title} - {e.id}  </p>)} </div> 
    }
}


export default Tasks;
